import styled from 'styled-components'
import { templateBackground } from 'styles/OftenStyle'

export const SiteDetailsDiv = styled.div`
    ${templateBackground}
    display: flex;
    height: 100vh;
    border: 1px solid red;
    > div:nth-child(1) {
        position: relative;
        flex: 78;
        display: flex;
        align-items: center;
        height: 100vh;
    }
    > div:nth-child(2) {
        flex: 22;
        height: 100vh;
    }
`
